    ReportsComponent.prototype.download = function () {
        var columns = [
            { title: "ID", dataKey: "id" },
            { title: "Name", dataKey: "name" },
            { title: "Country", dataKey: "country" },
        ];
        var rows = [
            { "id": 1, "name": "Shaw", "country": "Tanzania" },
            { "id": 2, "name": "Nelson", "country": "Kazakhstan" },
            { "id": 3, "name": "Garcia", "country": "Madagascar" }
        ];
        var col1 = [
            { title: "ID", dataKey: "id" },
            { title: "Name", dataKey: "name" },
            { title: "Country", dataKey: "country" },
        ];
        var rows1 = [
            { "id": 1, "name": "Shaw", "country": "Tanzania" },
            { "id": 2, "name": "Nelson", "country": "Kazakhstan" },
            { "id": 3, "name": "Garcia", "country": "Madagascar" }
        ];
        // Only pt supported (not mm or in)
        var doc = new __WEBPACK_IMPORTED_MODULE_1_jspdf__('p', 'pt');
        // var res = doc.autoTableHtmlToJson(document.getElementById('tbl1'));
        // doc.autoTable(res.columns, res.data);
        doc.autoTable(columns, rows, { startY: 10 });
        doc.autoTable(col1, rows1, { startY: 100 });
        doc.save('table.pdf');
    };
