    RoomtypesComponent.prototype.nextColumns = function () {
        this.clountnextprev++;
        if (this.countdates.length >= this.end) {
            this.start = this.start + 14;
            this.end = this.end + 14;
            if (this.start == 0) {
                this.prevflag = false;
            }
            else if (this.start > 0) {
                this.prevflag = true;
            }
        }
        if (this.countdates.length == this.end || this.countdates.length < this.end) {
            this.prevflag = true;
            this.nextflag = false;
        }
    };
    RoomtypesComponent.prototype.preveviousColumns = function () {
        this.clountnextprev--;
        if (this.start > 0) {
            this.start = this.start - 14;
            this.end = this.end - 14;
        }
        if (this.start == 0) {
            this.prevflag = false;
            this.nextflag = true;
        }
        if (this.countdates.length > this.end) {
            this.nextflag = true;
        }
    };
